import React, { useState, useEffect } from 'react';
import { Story, getStories, createStory, updateStory, deleteStory } from '../api/storyService';

const StoryList: React.FC = () => {
  const [stories, setStories] = useState<Story[]>([]);
  const [newStory, setNewStory] = useState<Omit<Story, '_id' | 'createdAt'>>({
    name: '',
    description: '',
    priority: 'medium',
    project: '',
    state: 'todo',
    owner: ''
  });
  const [editingStory, setEditingStory] = useState<Story | null>(null);

  useEffect(() => {
    loadStories();
  }, []);

  const loadStories = async () => {
    try {
      const data = await getStories();
      setStories(data);
    } catch (error) {
      console.error('Error loading stories:', error);
    }
  };

  const handleCreateStory = async (e: React.FormEvent) => {
    e.preventDefault();
    try {
      await createStory(newStory);
      setNewStory({ name: '', description: '', priority: 'medium', project: '', state: 'todo', owner: '' });
      loadStories();
    } catch (error) {
      console.error('Error creating story:', error);
    }
  };

  const handleUpdateStory = async (e: React.FormEvent) => {
    e.preventDefault();
    if (!editingStory) return;
    try {
      await updateStory(editingStory._id!, editingStory);
      setEditingStory(null);
      loadStories();
    } catch (error) {
      console.error('Error updating story:', error);
    }
  };

  const handleDeleteStory = async (id: string) => {
    try {
      await deleteStory(id);
      loadStories();
    } catch (error) {
      console.error('Error deleting story:', error);
    }
  };

  const openEditForm = (story: Story) => {
    setEditingStory(story);
  };

  const handlePriorityChange = (e: React.ChangeEvent<HTMLSelectElement>) => {
    const value = e.target.value as 'low' | 'medium' | 'high';
    setNewStory({ ...newStory, priority: value });
  };

  const handleStateChange = (e: React.ChangeEvent<HTMLSelectElement>) => {
    const value = e.target.value as 'todo' | 'doing' | 'done';
    setNewStory({ ...newStory, state: value });
  };

  const handleEditPriorityChange = (e: React.ChangeEvent<HTMLSelectElement>) => {
    if (editingStory) {
      const value = e.target.value as 'low' | 'medium' | 'high';
      setEditingStory({ ...editingStory, priority: value });
    }
  };

  const handleEditStateChange = (e: React.ChangeEvent<HTMLSelectElement>) => {
    if (editingStory) {
      const value = e.target.value as 'todo' | 'doing' | 'done';
      setEditingStory({ ...editingStory, state: value });
    }
  };

  return (
    <div className="container mx-auto p-4">
      <form onSubmit={handleCreateStory} className="mb-4 bg-gray-200 p-4 border border-black rounded">
        <input
          type="text"
          placeholder="Story Name"
          value={newStory.name}
          onChange={(e) => setNewStory({ ...newStory, name: e.target.value })}
          className="border p-2 mb-2 w-full"
        />
        <input
          type="text"
          placeholder="Story Description"
          value={newStory.description}
          onChange={(e) => setNewStory({ ...newStory, description: e.target.value })}
          className="border p-2 mb-2 w-full"
        />
        <select
          value={newStory.priority}
          onChange={handlePriorityChange}
          className="border p-2 mb-2 w-full"
        >
          <option value="low">Low</option>
          <option value="medium">Medium</option>
          <option value="high">High</option>
        </select>
        <input
          type="text"
          placeholder="Project ID"
          value={newStory.project}
          onChange={(e) => setNewStory({ ...newStory, project: e.target.value })}
          className="border p-2 mb-2 w-full"
        />
        <select
          value={newStory.state}
          onChange={handleStateChange}
          className="border p-2 mb-2 w-full"
        >
          <option value="todo">To Do</option>
          <option value="doing">Doing</option>
          <option value="done">Done</option>
        </select>
        <input
          type="text"
          placeholder="Owner ID"
          value={newStory.owner}
          onChange={(e) => setNewStory({ ...newStory, owner: e.target.value })}
          className="border p-2 mb-2 w-full"
        />
        <button type="submit" className="bg-blue-500 text-white p-2 rounded">Create Story</button>
      </form>

      {stories.map(story => (
        <div key={story._id} className="border border-black rounded mb-2 p-2">
          <h2>{story.name}</h2>
          <p>{story.description}</p>
          <p>{story.priority}</p>
          <p>{story.state}</p>
          <p>{story.owner}</p>
          <button onClick={() => openEditForm(story)} className="bg-green-500 text-white p-1 rounded mr-2">Edit</button>
          <button onClick={() => handleDeleteStory(story._id!)} className="bg-red-500 text-white p-1 rounded">Delete</button>
        </div>
      ))}

      {editingStory && (
        <form onSubmit={handleUpdateStory} className="mt-4 bg-gray-200 p-4 border border-black rounded">
          <input
            type="text"
            placeholder="Story Name"
            value={editingStory.name}
            onChange={(e) => setEditingStory({ ...editingStory, name: e.target.value })}
            className="border p-2 mb-2 w-full"
          />
          <input
            type="text"
            placeholder="Story Description"
            value={editingStory.description}
            onChange={(e) => setEditingStory({ ...editingStory, description: e.target.value })}
            className="border p-2 mb-2 w-full"
          />
          <select
            value={editingStory.priority}
            onChange={handleEditPriorityChange}
            className="border p-2 mb-2 w-full"
          >
            <option value="low">Low</option>
            <option value="medium">Medium</option>
            <option value="high">High</option>
          </select>
          <select
            value={editingStory.state}
            onChange={handleEditStateChange}
            className="border p-2 mb-2 w-full"
          >
            <option value="todo">To Do</option>
            <option value="doing">Doing</option>
            <option value="done">Done</option>
          </select>
          <button type="submit" className="bg-blue-500 text-white p-2 rounded">Update Story</button>
        </form>
      )}
    </div>
  );
};

export default StoryList;
